import React from 'react';

let count = 1;
const IncrementNumber = () => {
    console.log('Clicked!');
}
const App = () => {
    return (
        <>
            <h1> {count} </h1>
            <button onClick={IncrementNumber}> Add +1 </button>
        </>
    )
}

export default App;
